import logo from "./logo.svg";
import "./App.css";
import icon1 from "./icon1.svg";

function App() {
  return (
    <div className="App  bg-red-500 sm:bg-blue-400 md:bg-green-400 lg:bg-yellow-300 2xl:via-purple-500">
      <section className="max-w-[1005px] bg-orange-400 mx-auto">
        <nav className="h-14 flex items-center justify-center">
          <h1 className="text-2xl font-bold">ColonBroom</h1>
        </nav>

        <main className="flex h-auto mt-12">
          <div className="w-1/2 bg-slate-600 text-3xl pr-[50px]">
            <h1 className="font-bold">
              Soulagez la constipation, perdez du poids et réduisez les
              ballonnements !
            </h1>

            <div className="icon-grid grid grid-cols-3 gap-5 mt-6">
              <div className="flex flex-col ">
                <img src={icon1} alt=""></img>
                <p className="text-[10px]">Réduisez vos ballonnements</p>
              </div>
            </div>
          </div>
          <div className="w-1/2 bg-blue-600"></div>
        </main>
      </section>
    </div>
  );
}

export default App;
